window.onload=function(){let treeView=document.getElementById("tree-view");Array.from(treeView.getElementsByClassName("collapsible")).forEach(function(a){a.addEventListener("click",function(){toggle_tree_node(a)},false)})};function toggle_tree_node(a){let menuNode=a.nextSibling;if(menuNode.style.display==="block"){menuNode.style.display="none"}else{menuNode.style.display="block"}}function toggle_modal(){let modal=document.getElementById("modal");if(modal.style.visibility==="visible"){modal.style.visibility="hidden";document.body.className=document.body.className.replace(" modal-open","")}else{modal.style.visibility="visible";document.body.className=document.body.className+" modal-open"}};